The Department for Education (DfE) is seeking to procure a provider to establish a Centre of Excellence to manage the Language Hubs Programme. 

 
The role of the Centre of Excellence will include: 

Managing a network of lead and partner hub schools, with national coverage, to deliver their strategic priorities; 

Delivering continuous professional development (CPD) courses to language teachers nationally; 

Managing, or arrange for a sub-contractor to manage, a discrete German Promotion Programme;  

Increasing the profile of, and access to, home, heritage, and community languages; 

Complementing other DfE language initiatives and wider curriculum programmes. 

The contractor will deliver the aims of the Language Hubs programme. This includes increasing primary and secondary teacher quality and confidence in languages teaching, improving transition from Key Stage 2 to Key Stage 3, and increasing opportunities to study languages for those students from disadvantaged backgrounds. The contract is expected to begin on 02 March 2023. The contract will run for 3 years with potential for extension.  
 

A supplier market engagement event will take place via Teams on 

Monday 28th November 2022, 11:00-12:30 

Details of this event will be sent to interested parties following registration. 


Bidders who are not already registered on the portal can register here: https://education.app.jaggaer.com 

For any assistance required in registering please contact the Jaggaer helpdesk: help_UK@jaggaer.com

West Northamptonshire Council (WNC) would like to invite you to an information event about our proposed Home Care provision from 2023/24.

The event will include the following information:
•	Broad outline of the proposed model;
•	Indicative timelines for the proposed recommissioning of Homecare;
•	Estimated volumes of activity within West Northamptonshire;
•	How you can register to tender and pre prepare for the proposed recommissioning.

However, we will not be discussing anything to do with, or answering any questions on:
•             Pricing;
•             Fair Cost of Care.

We will not have a Question and Answer session at the event due to timescales, however questions are able to be submitted via email to justine.horrocks@westnorthants.gov.uk and a Q&A document will subsequently be sent out to all attendees following the event.

The event will take place via Microsoft Teams and will be held on Tuesday 29th November at 10.30am.

To attend this event, please email justine.horrocks@westnorthants.gov.uk no later than Friday 25th November to receive the Microsoft Teams information.
